const style = {
	display: 'flex',
	flexDirection: 'column',
	width: '30px',
	height: '30px',
	background: 'orange',
	color: 'black',
	cursor: 'pointer',
	fontWeight: 'bold'
}

const labels = { pointer : 'P', cli: '>'}

const Icon = props => {
	let {id} = props
	return <div style={style}><label>{labels[id]}</label></div>
}

export default Icon
